INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "カリン", 1, "", 0, 0, 190804, 1, 0, 60000, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 2, "", 0, 1, 0, 0, 0, 60000, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 2, "", 0, 1, 0, 0, 0, 60000, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 2, "", 0, 1, 0, 0, 0, 60000, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 2, "", 0, 2, 0, 0, 0, 60000, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 2, "", 0, 2, 0, 0, 0, 60000, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 2, "", 0, 2, 0, 0, 0, 60000, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 2, "", 0, 3, 0, 0, 0, 60000, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 2, "", 0, 3, 0, 0, 0, 60000, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 2, "", 0, 3, 0, 0, 0, 60000, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 2, "", 0, 3, 0, 0, 0, 60000, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 2, "", 0, 3, 0, 0, 0, 60000, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 2, "", 0, 4, 0, 0, 0, 60000, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 2, "", 0, 4, 0, 0, 0, 60000, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 2, "", 0, 4, 0, 0, 0, 60000, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (16, "", 2, "", 0, 4, 0, 0, 0, 60000, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (17, "", 2, "", 0, 4, 0, 0, 0, 60000, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (18, "カリン", 3, "", 0, 0, 190804, 2, 0, 60000, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (19, "カリン", 3, "", 0, 0, 190804, 3, 7, 60000, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (20, "ハツネ", 0, "", 0, 0, 101201, 1, 1, 80001, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (21, "ハツネ", 0, "", 0, 0, 101201, 2, 1, 80001, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (22, "シオリ", 1, "", 0, 0, 103801, 1, 1, 80001, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (23, "シオリ", 1, "", 0, 0, 103801, 2, 1, 80001, "来年も、\n一緒にいられたら…\nうれしいな", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (24, "キョウカ", 0, "", 0, 0, 103601, 1, 2, 80001, "あなたと一緒にいるようになって、\nもう1年ですか…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (25, "キョウカ", 0, "", 0, 0, 103601, 2, 2, 80001, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (26, "ミミ", 1, "", 0, 0, 102001, 1, 2, 80001, "おにいちゃんとあってから、\n1年たったよ～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (27, "ミミ", 1, "", 0, 0, 102001, 2, 2, 80001, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (28, "ミソギ", 2, "", 0, 0, 100401, 1, 2, 80001, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (29, "ミソギ", 2, "", 0, 0, 100401, 2, 2, 80001, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (30, "マホ", 0, "", 0, 0, 101001, 1, 3, 80001, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (31, "マホ", 0, "", 0, 0, 101001, 2, 3, 80001, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (32, "イリヤ", 1, "", 0, 0, 104401, 1, 3, 80001, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (33, "イリヤ", 1, "", 0, 0, 104401, 2, 3, 80001, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (34, "カオリ", 2, "", 0, 0, 101701, 1, 3, 80001, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (35, "カオリ", 2, "", 0, 0, 101701, 2, 3, 80001, "これからも、どうぞよろしく\nお願いするさ～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (36, "サレン", 0, "", 0, 0, 102801, 1, 4, 80001, "あんたと出会ってからもうそんなに\nたつのね～", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (37, "サレン", 0, "", 0, 0, 102801, 2, 4, 80001, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (38, "スズメ", 1, "", 0, 0, 102501, 1, 4, 80001, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (39, "スズメ", 1, "", 0, 0, 102501, 2, 4, 80001, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (40, "タマキ", 0, "", 0, 0, 104601, 1, 5, 80001, "振り返れば、今までいろんなことが\nあったにゃあ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (41, "タマキ", 0, "", 0, 0, 104601, 2, 5, 80001, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (42, "ミフユ", 1, "", 0, 0, 104801, 1, 5, 80001, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (43, "ミフユ", 1, "", 0, 0, 104801, 2, 5, 80001, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (44, "アキノ", 0, "", 0, 0, 103201, 1, 6, 80001, "あなたさまと出会ってもう1年…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (45, "アキノ", 0, "", 0, 0, 103201, 2, 6, 80001, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (46, "ユカリ", 1, "", 0, 0, 103401, 1, 6, 80001, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (47, "ユカリ", 1, "", 0, 0, 103401, 2, 6, 80001, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (48, "クリスティーナ", 0, "", 0, 0, 107101, 1, 7, 80001, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (49, "クリスティーナ", 0, "", 0, 0, 107101, 2, 7, 80001, "ともかくこれからも\n愉しませてくれよ☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (50, "ジュン", 1, "", 0, 0, 104701, 1, 7, 80001, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (51, "ジュン", 1, "", 0, 0, 104701, 2, 7, 80001, "見えないから分からないって？\nそれもそうだな…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (52, "トモ", 0, "", 0, 0, 103701, 1, 8, 80001, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (53, "トモ", 0, "", 0, 0, 103701, 2, 8, 80001, "これからもよろしくね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (54, "マツリ", 1, "", 0, 0, 100501, 1, 8, 80001, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (55, "マツリ", 1, "", 0, 0, 100501, 2, 8, 80001, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (56, "ミヤコ", 0, "", 0, 0, 100701, 1, 9, 80001, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (57, "ミヤコ", 0, "", 0, 0, 100701, 2, 9, 80001, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (58, "シノブ", 1, "", 0, 0, 103101, 1, 9, 80001, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (59, "シノブ", 1, "", 0, 0, 103101, 2, 9, 80001, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (60, "アンナ", 0, "", 0, 0, 100901, 1, 10, 80001, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (61, "アンナ", 0, "", 0, 0, 100901, 2, 10, 80001, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (62, "ナナカ", 1, "", 0, 0, 101301, 1, 10, 80001, "君と出会ってもう1年だって！\n早いねー！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (63, "ナナカ", 1, "", 0, 0, 101301, 2, 10, 80001, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (64, "ミツキ", 0, "", 0, 0, 105101, 1, 11, 80001, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (65, "ミツキ", 0, "", 0, 0, 105101, 2, 11, 80001, "これからも、いろんなところを\n調べさせてね？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (66, "ルカ", 1, "", 0, 0, 105601, 1, 11, 80001, "お前さんと出会ってもう1年か\n助太刀するつもりが", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (67, "ルカ", 1, "", 0, 0, 105601, 2, 11, 80001, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (68, "エリコ", 2, "", 0, 0, 102701, 1, 11, 80001, "早いものですわね、あなた様と\nお会いして、もう1年…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (69, "エリコ", 2, "", 0, 0, 102701, 2, 11, 80001, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (70, "アヤネ", 0, "", 0, 0, 102301, 1, 12, 80001, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (71, "アヤネ", 0, "", 0, 0, 102301, 2, 12, 80001, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (72, "チカ", 1, "", 0, 0, 104201, 1, 12, 80001, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (73, "チカ", 1, "", 0, 0, 104201, 2, 12, 80001, "私のことを見守ってください\nできることなら、ずっと…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (74, "クルミ", 2, "", 0, 0, 102101, 1, 12, 80001, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (75, "クルミ", 2, "", 0, 0, 102101, 2, 12, 80001, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (76, "シズル", 0, "", 0, 0, 104901, 1, 13, 80001, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (77, "シズル", 0, "", 0, 0, 104901, 2, 13, 80001, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (78, "リノ", 1, "", 0, 0, 101101, 1, 13, 80001, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (79, "リノ", 1, "", 0, 0, 101101, 2, 13, 80001, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (80, "ユイ", 0, "", 0, 0, 100201, 1, 14, 80001, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (81, "ユイ", 0, "", 0, 0, 100201, 2, 14, 80001, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (82, "ヒヨリ", 1, "", 0, 0, 100101, 1, 14, 80001, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (83, "ヒヨリ", 1, "", 0, 0, 100101, 2, 14, 80001, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (84, "レイ", 2, "", 0, 0, 100301, 1, 14, 80001, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (85, "レイ", 2, "", 0, 0, 100301, 2, 14, 80001, "キミに背中を預けられる日が、\n早くきますように", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (86, "ペコリーヌ", 0, "", 0, 0, 105801, 1, 15, 80001, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (87, "ペコリーヌ", 0, "", 0, 0, 105801, 2, 15, 80001, "これからもずっと、覚えていて\nくださいね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (88, "コッコロ", 1, "", 0, 0, 105901, 1, 15, 80001, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (89, "コッコロ", 1, "", 0, 0, 105901, 2, 15, 80001, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (90, "キャル", 2, "", 0, 0, 106001, 1, 15, 80001, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (91, "キャル", 2, "", 0, 0, 106001, 2, 15, 80001, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (92, "スズメ", 1, "", 0, 0, 112101, 1, 0, 60001, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (93, "", 2, "", 0, 1, 0, 0, 0, 60001, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (94, "", 2, "", 0, 1, 0, 0, 0, 60001, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (95, "", 2, "", 0, 1, 0, 0, 0, 60001, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (96, "", 2, "", 0, 1, 0, 0, 0, 60001, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (97, "", 2, "", 0, 1, 0, 0, 0, 60001, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (98, "", 2, "", 0, 2, 0, 0, 0, 60001, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (99, "", 2, "", 0, 2, 0, 0, 0, 60001, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (100, "", 2, "", 0, 2, 0, 0, 0, 60001, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (101, "", 2, "", 0, 2, 0, 0, 0, 60001, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (102, "", 2, "", 0, 2, 0, 0, 0, 60001, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (103, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (104, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (105, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (106, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (107, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (108, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (109, "", 2, "", 0, 3, 0, 0, 0, 60001, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (110, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (111, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (112, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (113, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (114, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (115, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (116, "", 2, "", 0, 4, 0, 0, 0, 60001, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (117, "スズメ", 3, "", 0, 0, 112101, 2, 0, 60001, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (118, "スズメ", 3, "", 0, 0, 112101, 3, 7, 60001, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (119, "ペコリーヌ", 0, "", 0, 0, 105801, 1, 1, 80003, "ヒューヒュー♪\nドンドンパフパフー♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (120, "コッコロ", 1, "", 0, 0, 105901, 1, 1, 80003, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (121, "コッコロ", 1, "", 0, 0, 105901, 2, 1, 80003, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (122, "キャル", 2, "", 0, 0, 106001, 1, 1, 80003, "え？　ちょっと\nいきなりなにっ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (123, "キャル", 2, "", 0, 0, 106001, 2, 1, 80003, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (124, "ペコリーヌ", 0, "", 0, 0, 105801, 2, 1, 80003, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (125, "ペコリーヌ", 0, "", 0, 0, 105801, 3, 1, 80003, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (126, "コッコロ", 1, "", 0, 0, 105901, 3, 1, 80003, "ですからその日に向けて\n今から気分を盛り上げているのです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (127, "キャル", 2, "", 0, 0, 106001, 3, 1, 80003, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (128, "コッコロ", 1, "", 0, 0, 105901, 4, 1, 80003, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (129, "ペコリーヌ", 0, "", 0, 0, 105801, 4, 1, 80003, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (130, "キャル", 2, "", 0, 0, 106001, 4, 1, 80003, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (131, "コッコロ", 1, "", 0, 0, 105901, 5, 1, 80003, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (132, "キャル", 0, "", 0, 0, 106001, 5, 2, 80003, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (133, "カリン", 1, "", 0, 0, 190801, 1, 2, 80003, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (134, "キャル", 0, "", 0, 0, 106001, 6, 2, 80003, "げっ…カリンじゃない\nなんでもないわよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (135, "カリン", 1, "", 0, 0, 190801, 2, 2, 80003, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (136, "キャル", 0, "", 0, 0, 106001, 7, 2, 80003, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (137, "カリン", 1, "", 0, 0, 190801, 3, 2, 80003, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (138, "キャル", 0, "", 0, 0, 106001, 8, 2, 80003, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (139, "キャル", 0, "", 0, 0, 106001, 9, 2, 80003, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (140, "カリン", 1, "", 0, 0, 190801, 4, 2, 80003, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (141, "キャル", 0, "", 0, 0, 106001, 10, 2, 80003, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (142, "カリン", 1, "", 0, 0, 190801, 5, 2, 80003, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (143, "キャル", 0, "", 0, 0, 106001, 11, 2, 80003, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (144, "コッコロ", 0, "", 0, 0, 105901, 6, 3, 80003, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (145, "ペコリーヌ", 1, "", 0, 0, 105801, 5, 3, 80003, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (146, "コッコロ", 0, "", 0, 0, 105901, 7, 3, 80003, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (147, "コッコロ", 0, "", 0, 0, 105901, 8, 3, 80003, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (148, "ペコリーヌ", 1, "", 0, 0, 105801, 6, 3, 80003, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (149, "ペコリーヌ", 1, "", 0, 0, 105801, 7, 3, 80003, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (150, "コッコロ", 0, "", 0, 0, 105901, 9, 3, 80003, "あとは、牧場に素敵な温泉が\n出来たとか…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (151, "ペコリーヌ", 1, "", 0, 0, 105801, 8, 3, 80003, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (152, "コッコロ", 0, "", 0, 0, 105901, 10, 3, 80003, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (153, "ペコリーヌ", 1, "", 0, 0, 105801, 9, 3, 80003, "えへへ、ありがとうございます\nコッコロちゃん！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (154, "コッコロ", 0, "", 0, 0, 105901, 11, 3, 80003, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (155, "ペコリーヌ", 1, "", 0, 0, 105801, 10, 3, 80003, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (156, "ペコリーヌ", 0, "", 0, 0, 105801, 11, 4, 80003, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (157, "キャル", 1, "", 0, 0, 106001, 12, 4, 80003, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (158, "ペコリーヌ", 0, "", 0, 0, 105801, 12, 4, 80003, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (159, "キャル", 1, "", 0, 0, 106001, 13, 4, 80003, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (160, "ペコリーヌ", 0, "", 0, 0, 105801, 13, 4, 80003, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (161, "キャル", 1, "", 0, 0, 106001, 14, 4, 80003, "…積極的？\nなんの話よ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (162, "ペコリーヌ", 0, "", 0, 0, 105801, 14, 4, 80003, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (163, "ペコリーヌ", 0, "", 0, 0, 105801, 15, 4, 80003, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (164, "キャル", 1, "", 0, 0, 106001, 15, 4, 80003, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (165, "ペコリーヌ", 0, "", 0, 0, 105801, 16, 4, 80003, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (166, "キャル", 1, "", 0, 0, 106001, 16, 4, 80003, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (167, "キャル", 1, "", 0, 0, 106001, 17, 4, 80003, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (168, "キャル", 0, "", 0, 0, 106001, 18, 5, 80003, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (169, "コッコロ", 1, "", 0, 0, 105901, 12, 5, 80003, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (170, "キャル", 0, "", 0, 0, 106001, 19, 5, 80003, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (171, "コッコロ", 1, "", 0, 0, 105901, 13, 5, 80003, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (172, "キャル", 0, "", 0, 0, 106001, 20, 5, 80003, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (173, "コッコロ", 1, "", 0, 0, 105901, 14, 5, 80003, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (174, "キャル", 0, "", 0, 0, 106001, 21, 5, 80003, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (175, "コッコロ", 1, "", 0, 0, 105901, 15, 5, 80003, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (176, "キャル", 0, "", 0, 0, 106001, 22, 5, 80003, "かくし芸？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (177, "コッコロ", 1, "", 0, 0, 105901, 16, 5, 80003, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (178, "キャル", 0, "", 0, 0, 106001, 23, 5, 80003, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (179, "ペコリーヌ", 0, "", 0, 0, 105801, 17, 6, 80003, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (180, "キャル", 2, "", 0, 0, 106001, 24, 6, 80003, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (181, "コッコロ", 1, "", 0, 0, 105901, 17, 6, 80003, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (182, "ペコリーヌ", 0, "", 0, 0, 105801, 18, 6, 80003, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (183, "キャル", 2, "", 0, 0, 106001, 25, 6, 80003, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (184, "コッコロ", 1, "", 0, 0, 105901, 18, 6, 80003, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (185, "キャル", 2, "", 0, 0, 106001, 26, 6, 80003, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (186, "キャル", 2, "", 0, 0, 106001, 27, 6, 80003, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (187, "キャル", 2, "", 0, 0, 106001, 28, 6, 80003, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (188, "ペコリーヌ", 0, "", 0, 0, 105801, 19, 6, 80003, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (189, "コッコロ", 1, "", 0, 0, 105901, 19, 6, 80003, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (190, "キャル", 2, "", 0, 0, 106001, 29, 6, 80003, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (191, "キャル", 0, "", 0, 0, 106001, 30, 7, 80003, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (192, "キャル", 0, "", 0, 0, 106001, 31, 7, 80003, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (193, "キャル", 0, "", 0, 0, 106001, 32, 7, 80003, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (194, "キャル", 0, "", 0, 0, 106001, 33, 7, 80003, "あー\nあー\n…声、これで大丈夫かしら？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (195, "キャル", 0, "", 0, 0, 106001, 34, 7, 80003, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (196, "キャル", 0, "", 0, 0, 106001, 35, 7, 80003, "オイッスー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (197, "キャル", 0, "", 0, 0, 106001, 36, 7, 80003, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (198, "キャル", 0, "", 0, 0, 106001, 37, 7, 80003, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (199, "キャル", 0, "", 0, 0, 106001, 38, 7, 80003, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (200, "コッコロ", 0, "", 0, 0, 105901, 20, 8, 80003, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (201, "コッコロ", 0, "", 0, 0, 105901, 21, 8, 80003, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (202, "コッコロ", 0, "", 0, 0, 105901, 22, 8, 80003, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (203, "コッコロ", 0, "", 0, 0, 105901, 23, 8, 80003, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (204, "コッコロ", 0, "", 0, 0, 105901, 24, 8, 80003, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (205, "コッコロ", 0, "", 0, 0, 105901, 25, 8, 80003, "オイッスー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (206, "コッコロ", 0, "", 0, 0, 105901, 26, 8, 80003, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (207, "コッコロ", 0, "", 0, 0, 105901, 27, 8, 80003, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (208, "コッコロ", 0, "", 0, 0, 105901, 28, 8, 80003, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (209, "ペコリーヌ", 0, "", 0, 0, 105801, 20, 9, 80003, "オイッスー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (210, "ペコリーヌ", 0, "", 0, 0, 105801, 21, 9, 80003, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (211, "ペコリーヌ", 0, "", 0, 0, 105801, 22, 9, 80003, "あと６日で2.5周年ですか…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (212, "ペコリーヌ", 0, "", 0, 0, 105801, 23, 9, 80003, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (213, "ペコリーヌ", 0, "", 0, 0, 105801, 24, 9, 80003, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (214, "ペコリーヌ", 0, "", 0, 0, 105801, 25, 9, 80003, "オイッスー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (215, "ペコリーヌ", 0, "", 0, 0, 105801, 26, 9, 80003, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (216, "ペコリーヌ", 0, "", 0, 0, 105801, 27, 9, 80003, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (217, "ペコリーヌ", 0, "", 0, 0, 105801, 28, 9, 80003, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (218, "ペコリーヌ", 0, "", 0, 0, 105801, 29, 9, 80003, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (219, "ペコリーヌ", 0, "", 0, 0, 105801, 30, 9, 80003, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (220, "ペコリーヌ", 0, "", 0, 0, 105801, 31, 10, 80003, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (221, "コッコロ", 1, "", 0, 0, 105901, 29, 10, 80003, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (222, "ペコリーヌ", 0, "", 0, 0, 105801, 32, 10, 80003, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (223, "キャル", 2, "", 0, 0, 106001, 39, 10, 80003, "…………", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (224, "コッコロ", 1, "", 0, 0, 105901, 30, 10, 80003, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (225, "キャル", 2, "", 0, 0, 106001, 40, 10, 80003, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (226, "ペコリーヌ", 0, "", 0, 0, 105801, 33, 10, 80003, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (227, "キャル", 2, "", 0, 0, 106001, 41, 10, 80003, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (228, "ペコリーヌ", 0, "", 0, 0, 105801, 34, 10, 80003, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (229, "ペコリーヌ", 0, "", 0, 0, 105801, 35, 10, 80003, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (230, "キャル", 2, "", 0, 0, 106001, 42, 10, 80003, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (231, "コッコロ", 1, "", 0, 0, 105901, 31, 10, 80003, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (232, "キャル", 2, "", 0, 0, 106001, 43, 10, 80003, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (233, "ペコリーヌ", 0, "", 0, 0, 105801, 36, 10, 80003, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (234, "カリン", 0, "", 0, 0, 190801, 6, 11, 80003, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (235, "カリン", 0, "", 0, 0, 190801, 7, 11, 80003, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (236, "カリン", 0, "", 0, 0, 190801, 8, 11, 80003, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (237, "カリン", 0, "", 0, 0, 190801, 9, 11, 80003, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (238, "カリン", 0, "", 0, 0, 190801, 10, 11, 80003, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (239, "カリン", 0, "", 0, 0, 190801, 11, 11, 80003, "次にコッコロさんですが\nこちらは発声練習をしています", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (240, "カリン", 0, "", 0, 0, 190801, 12, 11, 80003, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (241, "カリン", 0, "", 0, 0, 190801, 13, 11, 80003, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (242, "カリン", 0, "", 0, 0, 190801, 14, 11, 80003, "あれ？\nもしかして緊張で気を失って…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (243, "カリン", 0, "", 0, 0, 190801, 15, 11, 80003, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (244, "カリン", 0, "", 0, 0, 190801, 16, 11, 80003, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (245, "カリン", 0, "", 0, 0, 190801, 17, 11, 80003, "それでは\nまた明日お会いしましょう♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (246, "キャル", 0, "", 0, 0, 106001, 44, 12, 80003, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (247, "ペコリーヌ", 2, "", 0, 0, 105801, 37, 12, 80003, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (248, "コッコロ", 1, "", 0, 0, 105901, 32, 12, 80003, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (249, "キャル", 0, "", 0, 0, 106001, 45, 12, 80003, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (250, "ペコリーヌ", 2, "", 0, 0, 105801, 38, 12, 80003, "ひどいですよぉキャルちゃ～ん！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (251, "コッコロ", 1, "", 0, 0, 105901, 33, 12, 80003, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (252, "ペコリーヌ", 2, "", 0, 0, 105801, 39, 12, 80003, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (253, "キャル", 0, "", 0, 0, 106001, 46, 12, 80003, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (254, "コッコロ", 1, "", 0, 0, 105901, 34, 12, 80003, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (255, "ペコリーヌ", 2, "", 0, 0, 105801, 40, 12, 80003, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (256, "ペコリーヌ", 0, "", 0, 0, 105801, 41, 13, 80003, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (257, "キャル", 2, "", 0, 0, 106001, 47, 13, 80003, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (258, "ペコリーヌ", 0, "", 0, 0, 105801, 42, 13, 80003, "忘れてきちゃいました☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (259, "キャル", 2, "", 0, 0, 106001, 48, 13, 80003, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (260, "コッコロ", 1, "", 0, 0, 105901, 35, 13, 80003, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (261, "キャル", 2, "", 0, 0, 106001, 49, 13, 80003, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (262, "ペコリーヌ", 0, "", 0, 0, 105801, 43, 13, 80003, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (263, "キャル", 2, "", 0, 0, 106001, 50, 13, 80003, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (264, "コッコロ", 1, "", 0, 0, 105901, 36, 13, 80003, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (265, "キャル", 2, "", 0, 0, 106001, 51, 13, 80003, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (266, "コッコロ", 1, "", 0, 0, 105901, 37, 13, 80003, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (267, "キャル", 2, "", 0, 0, 106001, 52, 13, 80003, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (268, "ペコリーヌ", 0, "", 0, 0, 105801, 44, 13, 80003, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (269, "コッコロ", 1, "", 0, 0, 105901, 38, 13, 80003, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (270, "ペコリーヌ", 0, "", 0, 0, 105801, 45, 13, 80003, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (271, "キャル", 2, "", 0, 0, 106001, 53, 13, 80003, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (272, "ペコリーヌ", 0, "", 0, 0, 105801, 46, 13, 80003, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (273, "カリン", 0, "", 0, 0, 190801, 18, 14, 80003, "こんにちは\n【ギルド管理協会】のカリンです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (274, "カリン", 0, "", 0, 0, 190801, 19, 14, 80003, "昨日の生放送は\nいかがだったでしょうか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (275, "カリン", 0, "", 0, 0, 190801, 20, 14, 80003, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (276, "カリン", 0, "", 0, 0, 190801, 21, 14, 80003, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (277, "カリン", 0, "", 0, 0, 190801, 22, 14, 80003, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (278, "カリン", 0, "", 0, 0, 190801, 23, 14, 80003, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (279, "カリン", 0, "", 0, 0, 190801, 24, 14, 80003, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (280, "カリン", 0, "", 0, 0, 190801, 25, 14, 80003, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (281, "カリン", 0, "", 0, 0, 190801, 26, 14, 80003, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (282, "カリン", 0, "", 0, 0, 190801, 27, 14, 80003, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (283, "ペコリーヌ", 0, "", 0, 0, 105801, 47, 15, 80003, "準備はいいですかっ？\n…いっきますよー！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (284, "キャル", 2, "", 0, 0, 106001, 54, 15, 80003, "祝！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (285, "コッコロ", 1, "", 0, 0, 105901, 39, 15, 80003, "2.5周年！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (286, "ペコリーヌ", 0, "", 0, 0, 105801, 48, 15, 80003, "おめでとうございま～す☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (287, "キャル", 2, "", 0, 0, 106001, 55, 15, 80003, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (288, "コッコロ", 1, "", 0, 0, 105901, 40, 15, 80003, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (289, "ペコリーヌ", 0, "", 0, 0, 105801, 49, 15, 80003, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (290, "キャル", 2, "", 0, 0, 106001, 56, 15, 80003, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (291, "コッコロ", 1, "", 0, 0, 105901, 41, 15, 80003, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (292, "キャル", 2, "", 0, 0, 106001, 57, 15, 80003, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (293, "ペコリーヌ", 0, "", 0, 0, 105801, 50, 15, 80003, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (294, "キャル", 2, "", 0, 0, 106001, 58, 15, 80003, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (295, "ペコリーヌ", 0, "", 0, 0, 105801, 51, 15, 80003, "記念日だから\n平気平気♪\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (296, "キャル", 2, "", 0, 0, 106001, 59, 15, 80003, "意味分かんないわよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (297, "コッコロ", 1, "", 0, 0, 105901, 42, 15, 80003, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (298, "コッコロ", 1, "", 0, 0, 105901, 43, 15, 80003, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (299, "ペコリーヌ", 0, "", 0, 0, 105801, 52, 15, 80003, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (300, "キャル", 2, "", 0, 0, 106001, 60, 15, 80003, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (301, "コッコロ", 1, "", 0, 0, 105901, 44, 15, 80003, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (302, "ペコリーヌ", 0, "", 0, 0, 105801, 53, 15, 80003, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (303, "ペコリーヌ・コッコロ・キャル", 0, "105901,45,106001,61", 1, 0, 105801, 54, 15, 80003, "2.5周年\nありがとうございます！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (304, "カリン", 1, "", 0, 0, 190804, 1, 0, 60002, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (305, "", 2, "", 0, 1, 0, 0, 0, 60002, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (306, "", 2, "", 0, 1, 0, 0, 0, 60002, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (307, "", 2, "", 0, 1, 0, 0, 0, 60002, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (308, "", 2, "", 0, 1, 0, 0, 0, 60002, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (309, "", 2, "", 0, 1, 0, 0, 0, 60002, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (310, "", 2, "", 0, 2, 0, 0, 0, 60002, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (311, "", 2, "", 0, 2, 0, 0, 0, 60002, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (312, "", 2, "", 0, 2, 0, 0, 0, 60002, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (313, "", 2, "", 0, 2, 0, 0, 0, 60002, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (314, "", 2, "", 0, 2, 0, 0, 0, 60002, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (315, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (316, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (317, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (318, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (319, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (320, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (321, "", 2, "", 0, 3, 0, 0, 0, 60002, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (322, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (323, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (324, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (325, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (326, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (327, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (328, "", 2, "", 0, 4, 0, 0, 0, 60002, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (329, "カリン", 3, "", 0, 0, 190804, 2, 0, 60002, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (330, "カリン", 3, "", 0, 0, 190804, 3, 7, 60002, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (331, "コッコロ", 4, "", 0, 0, 105901, 1, 1, 80005, "ささ、シェフィさまはこちらへ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (332, "シェフィ", 0, "", 0, 0, 106401, 1, 1, 80005, "コッコロさん、どこへ行くの…？\n…え？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (333, "ペコリーヌ", 3, "", 0, 0, 105801, 1, 1, 80005, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (334, "コッコロ", 4, "", 0, 0, 105901, 2, 1, 80005, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (335, "シェフィ", 0, "", 0, 0, 106401, 2, 1, 80005, "ええと…\n二人とも何をしているの？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (336, "キャル", 1, "", 0, 0, 106001, 1, 1, 80005, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (337, "シェフィ", 0, "", 0, 0, 106401, 3, 1, 80005, "あの日…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (338, "ペコリーヌ", 3, "", 0, 0, 105801, 2, 1, 80005, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (339, "ペコリーヌ", 3, "", 0, 0, 105801, 3, 1, 80005, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (340, "カリン", 2, "", 0, 0, 190801, 1, 1, 80005, "やばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (341, "キャル", 1, "", 0, 0, 106001, 2, 1, 80005, "って、なにしれっと\n参加してんのよカリン！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (342, "カリン", 2, "", 0, 0, 190801, 2, 1, 80005, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (343, "カリン", 2, "", 0, 0, 190801, 3, 1, 80005, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (344, "ペコリーヌ", 3, "", 0, 0, 105801, 4, 1, 80005, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (345, "シェフィ", 0, "", 0, 0, 106401, 4, 1, 80005, "えっ！？　ええとええと…！\nあ、あと14日…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (346, "ペコリーヌ", 3, "", 0, 0, 105801, 5, 2, 80005, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (347, "コッコロ", 1, "", 0, 0, 105901, 3, 2, 80005, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (348, "コッコロ", 1, "", 0, 0, 105901, 4, 2, 80005, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (349, "ペコリーヌ", 3, "", 0, 0, 105801, 6, 2, 80005, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (350, "コッコロ", 1, "", 0, 0, 105901, 5, 2, 80005, "さすがでございます\nペコリーヌさま", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (351, "キャル", 0, "", 0, 0, 106001, 3, 2, 80005, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (352, "シェフィ", 2, "", 0, 0, 106401, 5, 2, 80005, "しゃなり、しゃなり…\nふふ、案外できるものね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (353, "ペコリーヌ", 3, "", 0, 0, 105801, 7, 2, 80005, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (354, "コッコロ", 1, "", 0, 0, 105901, 6, 2, 80005, "さ、次はキャルさまの\n番でございますよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (355, "キャル", 0, "", 0, 0, 106001, 4, 2, 80005, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (356, "シェフィ", 2, "", 0, 0, 106401, 6, 2, 80005, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (357, "キャル", 0, "", 0, 0, 106001, 5, 2, 80005, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (358, "キャル", 0, "", 0, 0, 106001, 6, 2, 80005, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (359, "コッコロ", 1, "", 0, 0, 105901, 7, 2, 80005, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (360, "キャル", 0, "", 0, 0, 106001, 7, 2, 80005, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (361, "コッコロ", 1, "", 0, 0, 105901, 8, 3, 80005, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (362, "ペコリーヌ", 3, "", 0, 0, 105801, 8, 3, 80005, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (363, "コッコロ", 1, "", 0, 0, 105901, 9, 3, 80005, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (364, "シェフィ", 2, "", 0, 0, 106401, 7, 3, 80005, "聖学祭…って、なにかしら？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (365, "コッコロ", 1, "", 0, 0, 105901, 10, 3, 80005, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (366, "キャル", 0, "", 0, 0, 106001, 8, 3, 80005, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (367, "キャル", 0, "", 0, 0, 106001, 9, 3, 80005, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (368, "ペコリーヌ", 3, "", 0, 0, 105801, 9, 3, 80005, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (369, "キャル", 0, "", 0, 0, 106001, 10, 3, 80005, "いや、そのまんますぎでしょ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (370, "シェフィ", 2, "", 0, 0, 106401, 8, 3, 80005, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (371, "ペコリーヌ", 3, "", 0, 0, 105801, 10, 3, 80005, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (372, "シェフィ", 2, "", 0, 0, 106401, 9, 3, 80005, "えっ？　ええ…\nぎゅーっ…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (373, "キャル", 0, "", 0, 0, 106001, 11, 4, 80005, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (374, "シェフィ", 2, "", 0, 0, 106401, 10, 4, 80005, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (375, "キャル", 0, "", 0, 0, 106001, 12, 4, 80005, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (376, "コッコロ", 1, "", 0, 0, 105901, 11, 4, 80005, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (377, "キャル", 0, "", 0, 0, 106001, 13, 4, 80005, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (378, "ペコリーヌ", 3, "", 0, 0, 105801, 11, 4, 80005, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (379, "キャル", 0, "", 0, 0, 106001, 14, 4, 80005, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (380, "キャル", 0, "", 0, 0, 106001, 15, 4, 80005, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (381, "シェフィ", 2, "", 0, 0, 106401, 11, 4, 80005, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (382, "ペコリーヌ", 3, "", 0, 0, 105801, 12, 4, 80005, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (383, "コッコロ", 1, "", 0, 0, 105901, 12, 4, 80005, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (384, "キャル", 0, "", 0, 0, 106001, 16, 4, 80005, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (385, "シェフィ", 2, "", 0, 0, 106401, 12, 4, 80005, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (386, "ペコリーヌ", 3, "", 0, 0, 105801, 13, 5, 80005, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (387, "ペコリーヌ", 3, "", 0, 0, 105801, 14, 5, 80005, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (388, "ペコリーヌ", 3, "", 0, 0, 105801, 15, 5, 80005, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (389, "キャル", 0, "", 0, 0, 106001, 17, 5, 80005, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (390, "キャル", 0, "", 0, 0, 106001, 18, 5, 80005, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (391, "シェフィ", 2, "", 0, 0, 106401, 13, 5, 80005, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (392, "コッコロ", 1, "", 0, 0, 105901, 13, 5, 80005, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (393, "ペコリーヌ", 3, "", 0, 0, 105801, 16, 5, 80005, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (394, "キャル", 0, "", 0, 0, 106001, 19, 5, 80005, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (395, "ペコリーヌ", 3, "", 0, 0, 105801, 17, 5, 80005, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (396, "ペコリーヌ", 3, "", 0, 0, 105801, 18, 5, 80005, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (397, "ペコリーヌ", 3, "", 0, 0, 105801, 19, 5, 80005, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (398, "カリン", 2, "", 0, 0, 190801, 4, 6, 80005, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (399, "カリン", 2, "", 0, 0, 190801, 5, 6, 80005, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (400, "キャル", 1, "", 0, 0, 106001, 20, 6, 80005, "…えっ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (401, "ペコリーヌ", 3, "", 0, 0, 105801, 20, 6, 80005, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (402, "シェフィ", 0, "", 0, 0, 106401, 14, 6, 80005, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (403, "コッコロ", 4, "", 0, 0, 105901, 14, 6, 80005, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (404, "シェフィ", 0, "", 0, 0, 106401, 15, 6, 80005, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (405, "キャル", 1, "", 0, 0, 106001, 21, 6, 80005, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (406, "ペコリーヌ", 3, "", 0, 0, 105801, 21, 6, 80005, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (407, "キャル", 1, "", 0, 0, 106001, 22, 6, 80005, "ぶっ殺すぞ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (408, "カリン", 2, "", 0, 0, 190801, 6, 6, 80005, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (409, "コッコロ", 1, "", 0, 0, 105901, 15, 7, 80005, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (410, "キャル", 0, "", 0, 0, 106001, 23, 7, 80005, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (411, "シェフィ", 2, "", 0, 0, 106401, 16, 7, 80005, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (412, "ペコリーヌ", 3, "", 0, 0, 105801, 22, 7, 80005, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (413, "キャル", 0, "", 0, 0, 106001, 24, 7, 80005, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (414, "シェフィ", 2, "", 0, 0, 106401, 17, 7, 80005, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (415, "コッコロ", 1, "", 0, 0, 105901, 16, 7, 80005, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (416, "シェフィ", 2, "", 0, 0, 106401, 18, 7, 80005, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (417, "コッコロ", 1, "", 0, 0, 105901, 17, 7, 80005, "もちろんでございます\n仲良くお勉強いたしましょう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (418, "キャル", 0, "", 0, 0, 106001, 25, 7, 80005, "しれっと教育ママが\n生まれてる…？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (419, "ペコリーヌ", 3, "", 0, 0, 105801, 23, 7, 80005, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (420, "キャル", 0, "", 0, 0, 106001, 26, 7, 80005, "え～～～～！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (421, "キャル", 0, "", 0, 0, 106001, 27, 8, 80005, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (422, "シェフィ", 2, "", 0, 0, 106401, 19, 8, 80005, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (423, "コッコロ", 1, "", 0, 0, 105901, 18, 8, 80005, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (424, "ペコリーヌ", 3, "", 0, 0, 105801, 24, 8, 80005, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (425, "シェフィ", 2, "", 0, 0, 106401, 20, 8, 80005, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (426, "キャル", 0, "", 0, 0, 106001, 28, 8, 80005, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (427, "コッコロ", 1, "", 0, 0, 105901, 19, 8, 80005, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (428, "シェフィ", 2, "", 0, 0, 106401, 21, 8, 80005, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (429, "キャル", 0, "", 0, 0, 106001, 29, 8, 80005, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (430, "キャル", 0, "", 0, 0, 106001, 30, 8, 80005, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (431, "ペコリーヌ", 3, "", 0, 0, 105801, 25, 8, 80005, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (432, "キャル", 0, "", 0, 0, 106001, 31, 8, 80005, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (433, "シェフィ", 0, "", 0, 0, 106401, 22, 9, 80005, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (434, "シェフィ", 0, "", 0, 0, 106401, 23, 9, 80005, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (435, "シェフィ", 0, "", 0, 0, 106401, 24, 9, 80005, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (436, "シェフィ", 0, "", 0, 0, 106401, 25, 9, 80005, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (437, "シェフィ", 0, "", 0, 0, 106401, 26, 9, 80005, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (438, "シェフィ", 0, "", 0, 0, 106401, 27, 9, 80005, "それから、それから…！\nぅ、ぅぅっ…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (439, "シェフィ", 0, "", 0, 0, 106401, 28, 9, 80005, "―びえぇぇ～んっ！！！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (440, "コッコロ", 1, "", 0, 0, 105901, 20, 9, 80005, "どうされましたか、シェフィさま", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (441, "シェフィ", 0, "", 0, 0, 106401, 29, 9, 80005, "ううっ…ひっく…\nママッ…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (442, "コッコロ", 1, "", 0, 0, 105901, 21, 9, 80005, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (443, "コッコロ", 1, "", 0, 0, 105901, 22, 9, 80005, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (444, "シェフィ", 0, "", 0, 0, 106401, 30, 9, 80005, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (445, "コッコロ", 0, "", 0, 0, 105901, 23, 10, 80005, "主さま\n3.5周年まであと５日\nでございます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (446, "コッコロ", 0, "", 0, 0, 105901, 24, 10, 80005, "ですがその前に\n生放送がありますね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (447, "コッコロ", 0, "", 0, 0, 105901, 25, 10, 80005, "…生放送に向けた\n意気込みでございますか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (448, "コッコロ", 0, "", 0, 0, 105901, 26, 10, 80005, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (449, "コッコロ", 0, "", 0, 0, 105901, 27, 10, 80005, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (450, "コッコロ", 0, "", 0, 0, 105901, 28, 10, 80005, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (451, "コッコロ", 0, "", 0, 0, 105901, 29, 10, 80005, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (452, "コッコロ", 0, "", 0, 0, 105901, 30, 10, 80005, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (453, "コッコロ", 0, "", 0, 0, 105901, 31, 10, 80005, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (454, "ペコリーヌ", 0, "", 0, 0, 105801, 26, 11, 80005, "3.5周年まであと４日！\nやばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (455, "キャル", 1, "", 0, 0, 106001, 32, 11, 80005, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (456, "ペコリーヌ", 0, "", 0, 0, 105801, 27, 11, 80005, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (457, "ペコリーヌ", 0, "", 0, 0, 105801, 28, 11, 80005, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (458, "ペコリーヌ", 0, "", 0, 0, 105801, 29, 11, 80005, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (459, "キャル", 1, "", 0, 0, 106001, 33, 11, 80005, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (460, "ペコリーヌ", 0, "", 0, 0, 105801, 30, 11, 80005, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (461, "ペコリーヌ", 0, "", 0, 0, 105801, 31, 11, 80005, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (462, "ペコリーヌ", 0, "", 0, 0, 105801, 32, 11, 80005, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (463, "キャル", 1, "", 0, 0, 106001, 34, 11, 80005, "だからあたしはやるなんて一言も…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (464, "ペコリーヌ", 0, "", 0, 0, 105801, 33, 11, 80005, "オイッスー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (465, "キャル", 1, "", 0, 0, 106001, 35, 11, 80005, "聞きなさいっての！！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (466, "シェフィ", 2, "", 0, 0, 106401, 31, 12, 80005, "3.5周年まであと３日…\nそして生放送は、明日…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (467, "シェフィ", 2, "", 0, 0, 106401, 32, 12, 80005, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (468, "シェフィ", 2, "", 0, 0, 106401, 33, 12, 80005, "おいっす！\n…こうじゃなかったわね\nええと確か…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (469, "シェフィ", 2, "", 0, 0, 106401, 34, 12, 80005, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (470, "シェフィ", 2, "", 0, 0, 106401, 35, 12, 80005, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (471, "ペコリーヌ", 3, "", 0, 0, 105801, 34, 12, 80005, "やってますねシェフィちゃん！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (472, "キャル", 0, "", 0, 0, 106001, 36, 12, 80005, "なによ、考えることは\nみんな同じってこと？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (473, "コッコロ", 1, "", 0, 0, 105901, 32, 12, 80005, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (474, "シェフィ", 2, "", 0, 0, 106401, 36, 12, 80005, "みんな…もちろんよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (475, "ペコリーヌ", 3, "", 0, 0, 105801, 35, 12, 80005, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (476, "カリン", 2, "", 0, 0, 190801, 7, 13, 80005, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (477, "カリン", 2, "", 0, 0, 190801, 8, 13, 80005, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (478, "ペコリーヌ", 3, "", 0, 0, 105801, 36, 13, 80005, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (479, "カリン", 2, "", 0, 0, 190801, 9, 13, 80005, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (480, "コッコロ", 4, "", 0, 0, 105901, 33, 13, 80005, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (481, "カリン", 2, "", 0, 0, 190801, 10, 13, 80005, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (482, "キャル", 1, "", 0, 0, 106001, 37, 13, 80005, "大丈夫…大丈夫…\nあたしは大丈夫…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (483, "カリン", 2, "", 0, 0, 190801, 11, 13, 80005, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (484, "シェフィ", 0, "", 0, 0, 106401, 37, 13, 80005, "あうー？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (485, "みんな", 4, "105901,34,106001,38,190801,12", 1, 0, 105801, 37, 13, 80005, "あ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (486, "キャル", 1, "", 0, 0, 106001, 39, 13, 80005, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (487, "コッコロ", 4, "", 0, 0, 105901, 35, 13, 80005, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (488, "ペコリーヌ", 3, "", 0, 0, 105801, 38, 13, 80005, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (489, "カリン", 2, "", 0, 0, 190801, 13, 13, 80005, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (490, "シェフィ", 2, "", 0, 0, 106401, 38, 14, 80005, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (491, "ペコリーヌ", 3, "", 0, 0, 105801, 39, 14, 80005, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (492, "キャル", 0, "", 0, 0, 106001, 40, 14, 80005, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (493, "コッコロ", 1, "", 0, 0, 105901, 36, 14, 80005, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (494, "シェフィ", 2, "", 0, 0, 106401, 39, 14, 80005, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (495, "ペコリーヌ", 3, "", 0, 0, 105801, 40, 14, 80005, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (496, "コッコロ", 1, "", 0, 0, 105901, 37, 14, 80005, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (497, "キャル", 0, "", 0, 0, 106001, 41, 14, 80005, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (498, "シェフィ", 2, "", 0, 0, 106401, 40, 14, 80005, "へ、へぇ…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (499, "ペコリーヌ", 3, "", 0, 0, 105801, 41, 14, 80005, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (500, "シェフィ", 2, "", 0, 0, 106401, 41, 14, 80005, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (501, "シェフィ", 2, "", 0, 0, 106401, 42, 14, 80005, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (502, "ペコリーヌ", 3, "", 0, 0, 105801, 42, 15, 80005, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (503, "キャル", 1, "", 0, 0, 106001, 42, 15, 80005, "祝！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (504, "コッコロ", 4, "", 0, 0, 105901, 38, 15, 80005, "3.5周年！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (505, "シェフィ", 0, "", 0, 0, 106401, 43, 15, 80005, "おめでとうございます！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (506, "カリン", 2, "", 0, 0, 190801, 14, 15, 80005, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (507, "カリン", 2, "", 0, 0, 190801, 15, 15, 80005, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (508, "ペコリーヌ", 3, "", 0, 0, 105801, 43, 15, 80005, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (509, "ペコリーヌ", 3, "", 0, 0, 105801, 44, 15, 80005, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (510, "キャル", 1, "", 0, 0, 106001, 43, 15, 80005, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (511, "キャル", 1, "", 0, 0, 106001, 44, 15, 80005, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (512, "シェフィ", 0, "", 0, 0, 106401, 44, 15, 80005, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (513, "シェフィ", 0, "", 0, 0, 106401, 45, 15, 80005, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (514, "コッコロ", 4, "", 0, 0, 105901, 39, 15, 80005, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (515, "コッコロ", 4, "", 0, 0, 105901, 40, 15, 80005, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (516, "コッコロ", 4, "", 0, 0, 105901, 41, 15, 80005, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (517, "ペコリーヌ", 3, "", 0, 0, 105801, 45, 15, 80005, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (518, "みんな", 4, "105901,42,106001,45,106401,46,190801,16", 1, 0, 105801, 46, 15, 80005, "これからも\nよろしくおねがいします！", 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (519, "カリン", 1, "", 0, 0, 190804, 1, 0, 60003, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (520, "", 2, "", 0, 1, 0, 0, 0, 60003, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (521, "", 2, "", 0, 1, 0, 0, 0, 60003, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (522, "", 2, "", 0, 1, 0, 0, 0, 60003, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (523, "", 2, "", 0, 1, 0, 0, 0, 60003, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (524, "", 2, "", 0, 1, 0, 0, 0, 60003, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (525, "", 2, "", 0, 2, 0, 0, 0, 60003, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (526, "", 2, "", 0, 2, 0, 0, 0, 60003, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (527, "", 2, "", 0, 2, 0, 0, 0, 60003, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (528, "", 2, "", 0, 2, 0, 0, 0, 60003, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (529, "", 2, "", 0, 2, 0, 0, 0, 60003, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (530, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (531, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (532, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (533, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (534, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (535, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (536, "", 2, "", 0, 3, 0, 0, 0, 60003, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 2);
