INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (538, "", 2, "", 0, 4, 0, 0, 0, 60003, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 1);
